async () => {
  if (appsmith.store.token?.length < 1) {
    showAlert("Login required.", "error");
    navigateTo("login_page");
  }
  GetAllLots.run().then(() => {
    if (GetAllLots.data.error === "UNAUTHORIZED") {
      showAlert("Login required.", "error");
    }
  });
}

